import React from 'react';
import { Line } from "react-chartjs-2";
import * as FaIcons from 'react-icons/fa'
import { CircularProgressbar, buildStyles } from 'react-circular-progressbar';
import 'react-circular-progressbar/dist/styles.css';
import "./ProgressBar"

const progressBarStyles = buildStyles({
  pathColor: `rgba(0, 0, 0, 1)`,
  textColor: 'black'
})

const ProgressBar = () => {



  return(

    <div className='ProgressBar'>

    <div className='ProgressBar-header'>
        <FaIcons.FaChartPie className='ProgressBar-icon' size={20} color={'white'}/>
        <h3 className='ProgressBar-title'>Progress Bar</h3>

    </div>

    <div className='ProgressBar-body'>
        <div className='infocard'>
        <CircularProgressbar 
            className='progressbar' 
            value={"80"} 
            text={"80"}
            strokeWidth={12}
            styles={progressBarStyles} />

            <h5 className='card-title'>All Defects</h5>

         </div>



    </div>


    </div>









)
}

export default ProgressBar;
